import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { HashRouter, Route, Switch } from 'react-router-dom';
import App from './Pages/PageLogin/App';
/* ReactDOM.render(<App />, document.getElementById('root'));*/

function resizeToMinimum(){
    var minimum    = [640, 480];
    var current    = [window.outerWidth, window.outerHeight];
    var restricted = [];
    var i          = 2;

    while(i-- > 0){
      restricted[i] = minimum[i] > current[i] ? minimum[i] : current[i];
    }

    window.resizeTo(current[0], current[1]);
  }  

ReactDOM.render((
    <HashRouter>
       {resizeToMinimum}
      <Switch>
        <Route exact path="/" name="Login Page" component={App} />
        {/* <Route path="/admin" name="Admin" component={AdminFull} />
        <Route path="/" name="Inicio" component={Full} /> */}
      </Switch>
    </HashRouter>
  ), document.getElementById('root'));
